INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(6, 'Žalgiris võidutses Euroliigas kolmandat mängu järjest, CSKA alistas Zeniidi', 'Korvpalli Euroliigas sai Kaunase Žalgiris koduväljakul 96:85 jagu Moskva oblasti Himkist. Moskva CSKA alistas kodus Peterburi Zeniidi 86:78.\r\n\r\nKaunase Žalgiris kaotas vastasele punkte vaid kolmandal veerandil, kui viskas korvi 14 punkti vastase 24 vastu. Teised veerandid võitis Leedu klubi numbritega 29:15, 21:15, 32:27. Žalgirise parimana viskas 23 punkti Zach Leday. 15 silma lisas meeskonnale KC Rivers ja 14 silma Lukas Lekavicius. Moskva oblasti Himki resultatiivseim oli 24 punktiga Aleksei Šved.\r\n\r\nMoskva CSKA viskas koduväljakul avaveerandil 23 punkti vastase 21 vastu ning teisel veerandil 23 silma Peterburi Zeniidi 22 vastu. Kolmandal neljandikul ei vääratanud võõrustajad samuti ning kasvatasid oma edu vastase ees veel viie punkti võrra. Otsustavat veerandit alustati seisul 66:58 ning kaheksapunktiline eduseis säilis lõpuvileni. Mike James skooris CSKA parimana 27 punkti, üleplatsimeheks kerkis aga Peterburi Zaniidi ridades palliv Austin Hollins 28 silmaga.\r\n\r\nTeistes kohtumistes alistas Madridi Real võõral väljakul Milano Olimpia 78:73 ning Lyon-Villeurbanne sai kodus jagu Valenciast 72:65.\r\n\r\nTabelis jätkab Madridi Real (21-6) teisel kohal, Moskva CSKA (18-9) on viies, Valencia (12-14) seitsmes, Kaunase Žalgiris (12-15) üheksas, Moskva oblasti Himki (12-15) kümnes, Milano Olimpia (11-16) 12., Lyon-Villeurbanne (9-17) 16. ja Peterburi Zeniit (7-20) 18.', , 4, 3);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(7, 'Klimaatilist talve jagus vaid neljaks päevaks', 'Klimaatiline päristalv oli sellel aastal keskmisest viis korda lühem, jõudes kesta vaid neli päeva. Pikemas vaates pole tegu siiski rekordiga.\r\n\r\nIlmateenistus nentis, et talve ja kevadtalve algusaegade määramine on pehmete talvede korral problemaatiline ja subjektiivne. Andmetöötluse huvides on talvist aastaaega siiski eristatud. Selleks on talve keskosas esinenud pikim lumikattega ja külmailmadega periood.\r\n\r\nDefinitsiooni järgi on päristalve algus määratletud püsiva lumikattega perioodi algusega ning sellega kaasneb külmailmade sagenemine ja enamikel aastatel nende domineerimine. Klimaatilise talve kestuseks võib lugeda sel aastal seega perioodi 26.–29. veebruar.\r\n\r\nRekordit ei õnnestunud siiski murda. Kõige lühem päristalv kestis Eestis vaid kaks päeva. Kõige varasem kevadtalv saabus Vilsandil ja Sõrvel 1988. aastal juba 6. detsembril.\r\n\r\nKuigi selleaastane talv oli normist 2,5 °C võrra soojem, ei püstitatud rekordit ka selles vallas. Veel soojem oli 1961/1962. aasta talv.\r\n\r\nKüll võib raamatu \"Eesti kliima minevikus ja tänapäeval\" öelda, et vaatlusperioodi jooksul on nihkunud eeltalvede algus kahe nädala võrra hilisemaks. Sama saab öelda päristalvede kohta. Suure muutlikkuse tõttu pole viimased muutused samas kaugeltki usaldusväärsed. Tervikuna on päristalve pikkus lühenenud olulisel määral, enamikes vaatlusjaamades 26 päeva jagu.\r\n\r\nMöödunud aasta lõpus ilmunud Tartu Ülikooli doktorandi Birgit Viru ja professor Jaak Jaaguse töö põhjal on vähenenud alates 1950. aastast Eestis ka lumikattega päevade arv, riigis keskmiselt 27 päeva võrra. Lumikatte keskmine paksus vähenes sama ajaga sõltuvalt vaatlusjaamast 2–9 sentimeetrit.', , 1, 6);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(8, 'Bidenil on superteisipäeval Sandersi ees kindel edumaa', 'USA endine asepresident Joe Biden on demokraatide presidendikandidaadi eelvalimistel niinimetatud superteisipäeval edestamas kindlalt Vermonti senaatorit Bernie Sandersit. Analüütikute hinnangul on heitlus Demokraatliku Partei presidendikandidaadi koha pärast muutunud nüüd sisuliselt kahevõitluseks Bideni ja Sandersi vahel. Kogutud delegaatide arvestuses tõusis Biden nüüd Sandersi ees esikohale.\r\n\r\nUSA meedia prognooside kohaselt on Biden võitmas Alabama, Arkansas\', Minnesota, Põhja-Carolina, Massachusettsi, Oklahoma, Tennessee ja Virginia osariigis, vahendasid Axios, Vox ja BBC. Vox on eraldi artiklis toonud välja ka superteisipäeva võitjad ja kaotajad ning suurimaks võitjaks on kindlasti favoriidiks naasnud endine asepresident Biden. Miljardär Michael Bloombergi oodatust kehvem tulemus aga tõestavat, et presidendikandidaadi kohta siiski ei ole võimalik \"osta\".\r\n\r\nSanders on olnud edukas Colorados, Utah\'s ja koduosariigis Vermontis ning viimastel andmetel ka USA suurimas osariigis Californias.\r\n\r\nSuperteisipäeval osaleb eelvalimistel ühtekokku 14 USA osariiki, lisaks veel Ameerika Samoa, kus eelvalimised võitis New Yorgi endine linnapea Michael Bloomberg. Ameerika Samoas on kaalul kuus ja mujal kokku 1357 delegaati.\r\n\r\nBiden rõõmustas teda superteisipäeval saatva edu üle, edastasid meediakanalid.\r\n\r\n\"See on suurepärane öö ja läheb aina paremaks! Nad ei kutsu seda superteisipäevaks ilmaasjata,\" ütles Biden Los Angeleses toetajatele.\r\n\r\nVasakpoolsete vaadetega Vermonti senaator Bernie Sanders pole alla vandunud ja on endiselt veendunud võimaluses võita partei nominatsioon, edastasid kohalikud meediakanalid.\r\n\r\nSanders pidas toetajatele sütitava kõne hoolimata peamise rivaali Joe Bideni esialgsest selgest edust niinimetatud superteisipäeval. \"Täna, ma ütlen teile täie kindlusega, me võidame demokraatide nominatsiooni,\" kuulutas Sanders oma koduosariigis Vermontis, kus teda saatis eelvalimistel kindel edu.\r\n\r\n\r\nSuperteisipäeval on võistlustules veel viis USA demokraatide kandidaati (2)\r\n\"Ei saa võita Donald Trumpi sama vana poliitikaga,\" sõnas Sanders viidates Bidenile.\r\n\r\nSuurte osariikide California ja Texase tulemuste selgumine võtab veel aega, kui USA meedia viimastel andmetel edestab Sanders Bidenit Californias. Texases olevat aga üllatuslikult liidriks tõusnud hoopis Biden.\r\n\r\nAllikad: Bloomberg hindab olukorda\r\n\r\nUSA demokraatide kandidaadiks pürgiv endine New Yorgi linnapea Mike Bloomberg hindab olukorda pärast pettumustvalmistavaid tulemusi niinimetatud superteisipäeva demokraatide eelvalimistel, teatas tema kampaaniale lähedal seisev allikas.\r\n\r\nBloomberg kaalub tundmatuks jääda soovinud allika sõnul, kas tasub jätkata. Teise allika sõnul aga ei tähenda see asjaolu kindlasti seda, justkui kavatseks Bloomberg juba kolmapäeval loobumisest teatada.\r\n\r\nBloomberg on kulutanud kampaaniale rohkem kui pool miljardit dollarit ja ta tõi senistel andmetel võidu ära vaid tähtsusetust Ameerika Samoast.\r\n\r\nNew Yorgi endine linnapea on varem öelnud, et üheks tema eesmärgiks on ära hoida liigselt vasakpoolse ja lõhestava Sandersi tõus erakonna presidendikandidaadiks. Olukorras, kus hoopis Bidenist on saanud Sandersi selge vastaskandidaat, oleks Bloombergi kampaania jätkumine kasulik aga just Sandersile, sest Biden ja Bloomberg sisuliselt sööksid teineteise hääli. See on ka põhjus, miks mitmed mõõdukad demokraadid kutsuvad Bloombergi kandidatuurist loobuma ning oma jõud Bideni selja taha koondama.\r\n\r\n\r\nMinnesota senaator Klobuchar loobus demokraatide kandidaadiks pürgimisest\r\nSuperteisipäev arvudes\r\n\r\nSelleks, et tõusta kindlalt demokraatide presidendikandidaadiks, vajab kandidaat vähemalt 1990 delegaadi häält. Suve lõpus toimuval parteikongressil on just delegaadid need, kes hääletavad enda poolt esindatava kandidaadi poolt erakonna presidendikandidaadi valimistel.\r\n\r\nErinevalt vabariiklaste eelvalimistest ei saa demokraatide eelvalimistel ühes osariigis võitnud kandidaat kõiki selle osariigi delegaate, vaid delegaate võivad saada ka teisele, kolmandale vms kohale tulnud kandidaadid. Seega napp võit osariigis tähendab sisuliselt eda, et ka teise või kolmanda koha omaniku delegaatidesaak võib olla üsna märkimisväärne. Delegaatide arvutamiseks on loodud üsnagi keerukas süsteem ning eriti suurte osariikide nagu California või Texas puhul võib eeldatav võitja küll teada olla, kuid lõplik delegaatide jaotamine sõltub päevi kestvast häälte lugemisest, kirjutab Vox pikemas ülevaates.\r\n\r\nSuperteisipäeval toimusid eelvalimised 14 osariigis ja Ameerika Samoas.\r\n\r\nVermont: 16 delegaati, oma koduosariigis võitis Sanders.\r\n\r\nVirginia: 99 delegaati, võitjaks Biden.\r\n\r\nPõhja-Carolina: 110 delegaati, võitjaks Biden.\r\n\r\nAlabama: 52 delegaati, võitjaks Biden.\r\n\r\nMaine: 24 delegaati, võitja pole veel selge.\r\n\r\nOklahoma: 37 delegaati, võitjaks Biden.\r\n\r\nTennessee: 64 delegaati, võitjaks Biden.\r\n\r\nMassachusetts: 91 delegaati, võitjaks Biden. Eriti märkimisväärne on see, et senaator Elizabeth Warren jäi oma koduosariigis Bideni ja Sandersi järel kolmandale kohale.\r\n\r\n\r\nPete Buttigieg loobub Valgesse Majja pürgimast (2)\r\nArkansas: 31 delegaati, võitjaks Biden.\r\n\r\nTexas: 228 delegaati, võitja pole veel selge, kuid viimaste andmete on see Biden.\r\n\r\nColorado: 67 delegaati, võitjaks Sanders.\r\n\r\nMinnesota: 75 delegaati, võitjaks Biden.\r\n\r\nUtah: 29 delegaati, võitjaks Sanders.\r\n\r\nCalifornia: 415 delegaati, eeldatav võit Sandersile, kuid ka Bloombergi ja Bideni tulemused ei pruugi olla halvad.\r\n\r\nAmeerika Samoa: 6 delegaati, võit Michael Bloombergile. Siin peaks oma tõenäoliselt ainsa delegaadi võitma ka Tulsi Gabbard.\r\n\r\nViimaste andmete kohaselt on Bidenil nüüd 431 delegaati, Sandersil 368, Warrenil 40, Bloombergil 33 ja Gabbardil üks. Kampaaniast loobunud ja Bidenit toetanud Buttigiegil ning Klobucharil on vastavalt 26 ja 7 delegaati.\r\n\r\nVahemikus 10. märtsist 6. juunini toimuvatel demokraatide valimistel on võimalik kokku saada 2467 delegaati.\r\n\r\nVabariiklaste presidendikandidaadi eelvalimistel võidutses Trump\r\n\r\nVabariiklaste presidendikandidaadi eelvalimistel võidutses teisipäeval ootuspäraselt ametisolev riigipea Donald Trump. Trump on viimastel andmetel võitnud Põhja-Carolinas, Oklahomas, Arkansases, Texases ja Colorados.\r\n\r\nVabariiklaste eelvalimised toimuvad sisuliselt vaid seetõttu, et oma - paljuski sümboolse - kandidatuuri on üles seadnud Massachusettsi endine kuberner Bill Weld.\r\n\r\nBiden tänas oma endisi konkurente superteisipäeva edu eest\r\n\r\nUSA demokraatide presidendikandidaadi nominatsiooni taotlev endine asepresident Joe Biden tänas Los Angeleses poolehoidjaile kõneldes oma endisi konkurente toe väljendamise eest enne nõndanimetatud superteisipäeva eelvalimisi.\r\n\r\n\r\nUSA demokraatide Lõuna-Carolina eelvalimised võitis Joe Biden (1)\r\nSenaator Amy Klobuchar, endine kongresmen Beto O\'Rourke ja endine linnapea Pete Buttigieg loobusid heitlusest enne superteisipäeva ja asusid toetama Bidenit.\r\n\r\nErakonna mõõdukamat tiiba esindaval Bidenil on põhjust naeratuseks, sest ta jättis mitmes osariigis seljataha oma suurima võistleja, vasakpoolse Bernie Sandersi.\r\n\r\n\"Võitsime Minnesotas tänu Amy Klobucharile. Ja meil läheb väga hästi Texases tänu Beto O\'Rourke\'ile,\" lausus Biden.\r\n\r\nEndine asepresident lisas Buttigiegile viidates, et ta on \"äärmiselt uhke ka linnapea Pete\'i osutatud toetuse eest\".\r\n\r\n\"Oleme tõepoolest elus. Ärgu olgu siin kaksipidi mõistmist. Meie kampaania saadab Donald Trumpi asju pakkima.\"\r\n\r\nBiden kirjeldas teisipäevast eelvalimiste päeva suurepärasena. Ta lausus oma juubeldavatele poolehoidjatele, et seda valimispäeva ei nimetata asjata superteisipäevaks.\r\n\r\nBideni lennukast hoost hoolimata õhkus Sandersist endiselt võidutahet, kui koduosariigis Vermontis oma toetajatele kõneles. Ta ütles end olevat veendunud, et tema kampaania ja liikumine on parim alternatiiv demokraatide nonimatsioonile.\r\n\r\n\"Võidame, sest inimesed mõistavad, et see kampaania ja liikumine on parim alternatiiv president Donald Trumpi alistamiseks,\" ütles Sanders.\r\n\r\nTema sõnul ei saa Trumpi võita vana poliitika abil.\r\n\r\n\"Vajame uut poliitikat, mis toob töölisklassi ja noored meie poliitilisse liikumisse ja tõstab novembrikuise hääletusprotsendi suurimaks Ühendriikide ajaloos,\" kirjeldas Sanders.\r\n\r\n\r\nUSA demokraadid sarjasid televäitlusel Sandersit\r\nTAUST\r\n\r\nUSA demokraatidel oli niinimetatud superteisipäeval võimalik valida veel viie kandidaadi vahel. Realistlikku võimalust Demokraatliku Partei presidendikandidaadiks tõusta ja astuda novembris vastu vabariiklasi esindavale Donald Trumpile omas neist kolm (nüüd pigem juba kaks).\r\n\r\nTugevas positsioonis oli Vermonti senaator Bernie Sanders, kes oli delegaatide arvu poolest hetkel esikohal, kuid võiduga Lõuna-Carolinas jõudis talle üsna lähedale ka kunagine suurfavoriit, endine asepresident Joe Biden.\r\n\r\nPresidendikandidaadiks tõusmisest unistas tol hetkel realistlikult ka miljardär ja New Yorgi endine linnapea Michael Bloomberg, kes küll liitus otsese valimisprotsessiga alles nüüd.\r\n\r\nBidenile oli soodne ka asjaolu, et pärast Lõuna-Carolina eelvalimisi teatasid kampaaniast loobumisest kaks tsentristliku taustaga demokraati - South Bendi ekslinnapea Pete Buttigieg ja Minnesota senaator Amy Klobuchar. Mõlemad avaldasid pärast loobumist toetust Bidenile. Bidenile avaldas toetust ka kunagine presidendikandidaat Beto O\'Rourke. Varem esmaspäeval olid Bideni toetamisest teatanud president Barack Obama riikliku julgeoleku nõunik Susan Rice, endine senati demokraatide liider Harry Reid ja mitu kongressi liiget.\r\n\r\nKampaaniast loobunud kandidaatide kogutud delegaadid on parteikongressil hääletamisel vabad, kuid heaks tavaks on, et nad hääletavad kandidaadi poolt, kellele nende algne kandidaat toetust avaldanud on.\r\n\r\n\r\nSanders on valmis sõjaväge kasutama: me ei jää kõrvalt vaadates invasioone lubama (1)\r\nMassachusettsi senaatori Elizabethi Warreni võimalused erakonna presidendikandidaadiks tõusta olid juba enne superteisipäeva väiksemad. Tema reiting ja kogutud delegaatide arv olid kusjuures väiksem kui äsja loobumisest teatanud Buttigiegil.\r\n\r\nEndiselt on võistlustules ka Hawaii osariiki esindav esindajatekoja liige Tulsi Gabbard, kuid võimalus, et teda eelvalimistel mingi edu saadaks, on ebausutav. Marginaalseks kandidaadiks peetav Gabbard on tuntud oma ebatavaliste välispoliitiste seisukohtade tõttu, näiteks on ta sageli avaldanud toetust Venemaa tegevusele ning toetanud Süüria presidenti Bashar al-Assadit. Aeg-ajalt on tema isolatsionismi kalduv sõnum olnud mõnevõrra sarnane hoopis president Donald Trumpile.\r\n\r\nPärast eelvalimisi neljas osariigis (Iowas, New Hampshire\'is, Nevadas ja Lõuna-Carolinas) oli Sandersil 58, Bidenil 50, kampaaniast juba loobunud Pete Buttigiegil 26, Warrenil 8 ja loobunud Klobucharil 7 delegaati. Gabbardil ühtegi delegaati polnud ning delegaate polnud veel ka Bloombergil, sest tema ebatavalise kampaania puhul saaigi tema poolt esimest korda hääletada alles superteisipäeval.\r\n\r\nIowas võitis napilt Buttigieg, New Hampshire\'is ja Nevadas Sanders ning Lõuna-Carolinas naasis võidukalt suurde mängu Biden.\r\n\r\nOlukord Demokraatlikus Parteis võis (vähemalt enne superteisipäeva) teoreetiliselt viia ka selleni, et juulis Wisconsinis toimuva parteikongressi ajaks on Sanders küll kogunud kõige rohkem kandidaate, kuid mitte piisavat enamust, et kindlalt erakonna presidendikandidaadiks tõusta. Biden on kinnitanud, et sellises olukorras astub ta Sandersi vastaskandidaadina endiselt üles.\r\n\r\nSanders on omakorda veendunud, et demokraadid saavad siseprobleemidest üle ning erakond koguneb lõpliku presidendikandidaadi selja taha.', , 3, 8);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(9, 'Kaljurand: europarlament reageerib koroonameetmetega üle', 'Euroopa Parlamendi (EP) otsus sulgeda parlamendihoone uksed külastajatele ning sulgeda ka EP esindused liikmesriikides, sealhulgas Tallinnas, on üle pingutatud, leiab eestlasest saadik Marina Kaljurand. Eesti saadik avaldas ka imestust, et miks tehakse siiski erandeid, näiteks keskkonnaaktivist Greta Thunbergile.\r\n\r\nKaljurand (SDE) kirjutas sotsiaalmeedias, et Euroopa Parlamendi president David Sassoli teatavaks oma otsuse, millega suleti Euroopa Parlamendi uksed kõigile külastajatele. Parlamendihoonesse on lubatud ainult saadikud ja töötajad.\r\n\r\n\"Mida see tegelikult tähendab? Täna oli postkast umbes teadetest ürituste ärajäämise kohta. Parlament jätkab oma tavapärast tööd fraktsioonides ja komisjonides, aga ühtegi külalist arutelude juurde ei lubata. Samuti jäävad ära külalisgruppide külastused, kõik avalikud üritused ning parlamendiliikmete visiidid välismaale,\" kirjutas Kaljurand.\r\n\r\nEesti eurosaadik avaldas arvamust, et selliste meetmetega reageerib Euroopa Parlament üle, kuigi nakatumise risk on parlamendis kindlasti olemas ja ilmselt ka suurem, kui mõnes teises asutuses.\r\n\r\n\"Saavad ju Euroopa Parlamendis kokku saadikud kogu Euroopast, kes reisivad iga nädal Brüsseli ja koduriigi vahel ja seeläbi võivad ka viirust (kiiremini, kaugemale ja suuremal hulgal) levitada. Samas ei näe president probleemi selles, et järgmisel nädalal reisib umbes 3000-line seltskond (705 Euroopa Parlamendi saadikut + abid, assistendid, töötajad) Strasbourgi. Reisitakse koduriigist või Brüsselist: kes lennukiga, kes bussi, auto või rongiga. Milleks on seda vaja?\"\r\n\r\nKaljurand märgib, et kui EP president hindab koroonaviiruse leviku võimalust nii suureks, et suleb parlamendi uksed Brüsselis, siis tuleks ka piirata EP seltskonna mõttetut sõitmist Strasbourgi ja tagasi. Seda enam, et Prantsusmaa otsustas piirata massiüritusi ning sulges isegi Louvre\'i uksed.\r\n\r\n\r\nEuroopa Parlament kaalub koroonaviiruse tõttu saadikute kaugtööd\r\nArusaamatuks peab Kaljurand ka otsust, millega suleti EP esindused liikmesriikides, sealhulgas ka Tallinnas.\r\n\r\n\"Seda ohtu ei peaks ju hindama Brüsseli järgi, vaid iga konkreetse riigi järgi. Nii ongi Tallinnas tekkinud veider olukord, kus lasteiad, koolid ja kõik teised asutused töötavad, aga EP esindus on suletud. Arusaamatu.\"\r\n\r\nKaljurand avaldas ka imestust, miks mõned külalised siiski pääsevad EP majja, nende seas näiteks keskkonnaaktivist Greta Thunberg, kes osaleb keskonnakomisjon istungil. Kui reeglid kehtestatakse, siis peaks need kehtima kõigile võrdselt, leiab Kaljurand.\r\n\r\nMadison peab meetmeid õigeks\r\n\r\nSeevastu teine Eesti saadik europarlamendis Jaak Madison (EKRE) leidis, et tema toetab Sassoli otsuset keelata määramata ajaks parlamenti tulla külalistel, korraldada üritusi ja mitte teha komisjonides väliskülaliste kuulamisi. \r\n\r\n\"Otsusega olen ma päri - parem võtta asja ettevaatlikumalt, kuna igapäevaselt käib muidu parlamendis tuhandeid külastajaid väljastpoolt.\"\r\n\r\nKuid Sarnaselt Kaljurannale avaldas ka Madison imestust, miks tehti erand keskkonnaaktivist Greta Thunbergile.\r\n\r\n\"Homseks oli muidu planeeritud keskkonnakomisjoni üritus, kus külaliseks oodati ei kedagi muud, kui kliimatüdruk Greta Thunbergi. Kui muidu on tulnud massiliselt e-maile meie parlamendilisti ärajäävate ürituste kohta, siis keskkonnakomisjon saatis umbes tund tagasi kirja, et homne üritus toimub! Seega, kui kõik üritused on tühistatud ja keelatud väliskülaliste sissetulek parlamenti, siis Gretakene on erand. Miks? Ei tea. Kahepalgelisus. See tekitas aga meililistis tormi, kus vast kõikide poliitgruppide liikmed näitasid rahulolematust sellise topeltstandardi pärast.\"\r\n\r\nMadisoni sõnul kirjutas ta Euroopa Parlamendi president Sassolile kirja, et selline silmakirjalikkus on vastuvõetamatu.', , 2, 7);

